// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.18;

interface ISunnySideActivity {
    /* ==========================================================
     * User Management
     * ==========================================================
     */

    /// @notice Adds a user to the whitelist.
    /// @param user The address of the user to be whitelisted.
    function addToWhitelist(address user) external;

    /// @notice Checks if a user is whitelisted.
    /// @param user The address of the user to check.
    /// @return isWhitelisted Returns true if the user is whitelisted.
    function isWhitelisted(
        address user
    ) external view returns (bool isWhitelisted);

    /* ==========================================================
     * Referral System
     * ==========================================================
     */

    /// @notice Add a referral relationship.
    /// @param user The address of the referred.
    /// @param referrer The signature of the referrer.
    function joinWithReferral(address user, address referrer) external;

    /// @notice Checks if a user has already been referred.
    /// @param user The address of the user to check.
    /// @return isReferred Returns true if the user has already been referred.
    function isReferred(address user) external view returns (bool isReferred);

    /* ==========================================================
     * Points Management
     * ==========================================================
     */

    /// @notice Perform a daily login to earn points.
    function dailyLogin(address user) external;

    /// @notice Perform a fishing activity.
    /// @param fishName The type of fish caught (e.g., "Salmon", "Trout").
    function catchFish(address user, string calldata fishName) external;

    /// @notice Get the total points for a user.
    /// @param user The address of the user.
    /// @return totalPoints The total number of points the user has earned.
    function getUserPoints(
        address user
    ) external view returns (uint256 totalPoints);

    /// @notice Get the daily quest points for a user.
    /// @param user The address of the user.
    /// @return dailyQuestPoints The number of daily quest points the user has earned.
    function getDailyQuestPoints(
        address user
    ) external view returns (uint256 dailyQuestPoints);

    /// @notice Get the activity points for a user.
    /// @param user The address of the user.
    /// @return activityPoints The number of activity points the user has earned.
    function getActivityPoints(
        address user
    ) external view returns (uint256 activityPoints);

    /* ==========================================================
     * Events
     * ==========================================================
     */

    /// @dev Emitted when a whitelist user is added.
    /// @param user The address of the user who added to whitelist.
    /// @param whitelisted The whitelist status of the user.
    event WhitelistAdded(address indexed user, bool whitelisted);

    /// @dev Emitted when points are added to a user.
    /// @param user The address of the user who received points.
    /// @param activity The name of the activity.
    /// @param points The number of points added.
    event PointsAdded(
        address indexed user,
        string indexed activity,
        uint256 points
    );

    /// @dev Emitted when a referral is successfully completed.
    /// @param referrer The address of the referrer.
    /// @param referred The address of the referred user.
    event ReferralCompleted(address indexed referrer, address indexed referred);

    /// @dev Emitted when a user successfully performs a daily login.
    /// @param user The address of the user.
    /// @param pointsEarned The number of points earned from the daily login.
    event DailyLogin(address indexed user, uint256 pointsEarned);

    /// @dev Emitted when a user successfully catches a fish.
    /// @param user The address of the user.
    /// @param fishType The type of fish caught.
    /// @param pointsEarned The number of points earned for the fish.
    event FishCatched(
        address indexed user,
        string indexed fishType,
        uint256 pointsEarned
    );

    /// @dev Emitted when a user opens a random chest.
    /// @param user The address of the user.
    /// @param pointsEarned The number of points earned from the chest.
    event ChestOpened(address indexed user, uint256 pointsEarned);

    /// @dev Emitted when a new signer assigned to the contract.
    /// @param newSigner The address of the new signer.
    event SignerUpdated(address indexed newSigner);
}

contracts/SunnySideActivity.sol.content:
// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.18;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/PausableUpgradeable.sol";
import "@openzeppelin/contracts/utils/cryptography/ECDSA.sol";
import "./interface/ISunnySideActivity.sol";

contract SunnySideActivity is
    Initializable,
    OwnableUpgradeable,
    ReentrancyGuardUpgradeable,
    PausableUpgradeable,
    ISunnySideActivity
{
    using ECDSA for bytes32;
    /* ==========================================================
     * Constants
     * ==========================================================
     */

    uint256 public constant REFERRER_REWARD_POINTS = 100;
    uint256 public constant REFERRED_REWARD_POINTS = 50;
    uint256 public constant DAILY_LOGIN_POINTS = 5;
    uint256 public constant CHEST_COOLDOWN = 45 minutes;

    enum Activity {
        None,
        ReferralBonus,
        DailyLogin,
        Fishing,
        OpenChest
    }

    struct User {
        bool whitelisted; // Is user whitelisted
        bool referred; // Has the user been referred
        address referrer; // Address of the referrer
        uint256 totalPoints; // Total accumulated points
        uint256 dailyQuestPoints; // Points earned through daily quests
        uint256 activityPoints; // Points earned through activities
        uint256 lastLogin; // Last login timestamp
        uint256 lastActionTime; // Last activity timestamp (e.g., fishing or chest opening)
    }

    struct Fish {
        string fishName;
        uint256 rate;
        uint256 rewardPoint;
    }

    mapping(address => User) public users;
    mapping(address => uint256) public referralCounts;
    mapping(uint256 => string) public activityNames;

    Fish[] public fishList;

    /* ==========================================================
     * Modifier
     * ==========================================================
     */

    modifier onlyWhitelisted(address user) {
        require(users[user].whitelisted, "User not whitelisted");
        _;
    }

    /* ==========================================================
     * Errors
     * ==========================================================
     */

    error UserNotWhitelisted();
    error UserAlreadyWhitelisted();
    error AlreadyReferred();
    error CannotReferSelf();
    error ReferrerNotWhitelisted();
    error AlreadyLoggedInToday();
    error CooldownActive();

    constructor() {
        activityNames[uint256(Activity.None)] = "None";
        activityNames[uint256(Activity.ReferralBonus)] = "Referral Bonus";
        activityNames[uint256(Activity.DailyLogin)] = "Daily Login";
        activityNames[uint256(Activity.Fishing)] = "Fishing";
        activityNames[uint256(Activity.OpenChest)] = "Open Chest";
    }

    function initialize(address _owner) public initializer {
        __Ownable_init(_owner);
        __Pausable_init();
        __ReentrancyGuard_init();

        activityNames[uint256(Activity.None)] = "None";
        activityNames[uint256(Activity.ReferralBonus)] = "Referral Bonus";
        activityNames[uint256(Activity.DailyLogin)] = "Daily Login";
        activityNames[uint256(Activity.Fishing)] = "Fishing";
        activityNames[uint256(Activity.OpenChest)] = "Open Chest";
    }

    /* ==========================================================
     * SET
     * ==========================================================
     */

    function addToWhitelist(address user) external onlyOwner whenNotPaused {
        if (users[user].whitelisted) revert UserAlreadyWhitelisted();

        users[user].whitelisted = true;
        emit WhitelistAdded(user, true);
    }

    function joinWithReferral(
        address user,
        address referrer
    ) external onlyOwner whenNotPaused {
        // Check if the user is already whitelisted
        require(user != address(0), "Invalid Address");
        if (users[user].whitelisted) revert UserAlreadyWhitelisted();

        // Mark the user as whitelisted
        users[user].whitelisted = true;

        if (user == referrer) revert("Cannot refer self");
        if (users[user].referred) revert("Already referred");
        if (!users[referrer].whitelisted) revert("Referrer not whitelisted");

        // Apply referral rewards
        users[user].referred = true;
        users[user].referrer = referrer;

        users[referrer].totalPoints += REFERRER_REWARD_POINTS;
        users[user].totalPoints += REFERRED_REWARD_POINTS;
        referralCounts[referrer]++;

        emit ReferralCompleted(referrer, user);
        emit PointsAdded(
            user,
            activityNames[uint256(Activity.ReferralBonus)],
            REFERRED_REWARD_POINTS
        );
        emit PointsAdded(
            referrer,
            activityNames[uint256(Activity.ReferralBonus)],
            REFERRER_REWARD_POINTS
        );

        emit WhitelistAdded(user, true);
    }

    function dailyLogin(
        address user
    ) external onlyWhitelisted(user) onlyOwner whenNotPaused {
        if (block.timestamp <= users[user].lastLogin + 1 days)
            revert AlreadyLoggedInToday();

        uint256 pointsEarned = DAILY_LOGIN_POINTS;
        users[user].dailyQuestPoints += pointsEarned;
        users[user].totalPoints += pointsEarned;
        users[user].lastLogin = block.timestamp;

        emit DailyLogin(user, pointsEarned);
        emit PointsAdded(
            user,
            activityNames[uint256(Activity.DailyLogin)],
            pointsEarned
        );
    }

    function addListFish(
        string calldata fishName,
        uint256 rate,
        uint256 rewardPoint
    ) external onlyOwner {
        fishList.push(Fish(fishName, rate, rewardPoint));
    }

    function updateListFish(
        uint256 fishIndex,
        string calldata fishName,
        uint256 rate,
        uint256 rewardPoint
    ) external onlyOwner {
        require(fishIndex < fishList.length, "Invalid fish index");
        fishList[fishIndex] = Fish(fishName, rate, rewardPoint);
    }

    function catchFish(
        address user,
        string calldata fishName
    ) external onlyWhitelisted(user) onlyOwner whenNotPaused {
        bool fishFound = false;
        uint256 rewardPoint = 0;
        for (uint256 i = 0; i < fishList.length; i++) {
            if (
                keccak256(abi.encodePacked(fishList[i].fishName)) ==
                keccak256(abi.encodePacked(fishName))
            ) {
                fishFound = true;
                rewardPoint = fishList[i].rewardPoint;
                break;
            }
        }
        require(fishFound, "Fish not found");

        users[user].activityPoints += rewardPoint;
        users[user].totalPoints += rewardPoint;
        users[user].lastActionTime = block.timestamp;

        emit FishCatched(user, fishName, rewardPoint);
    }

    function addPoints(
        address user,
        Activity activity,
        uint256 points
    ) external onlyWhitelisted(user) onlyOwner whenNotPaused {
        users[user].activityPoints += points;
        users[user].totalPoints += points;
        users[user].lastActionTime = block.timestamp;

        emit PointsAdded(user, activityNames[uint256(activity)], points);
    }
    /* ==========================================================
     * GET
     * ==========================================================
     */

    function isWhitelisted(address user) external view returns (bool) {
        return users[user].whitelisted;
    }

    function isReferred(address user) external view returns (bool) {
        return users[user].referred;
    }

    function getUserPoints(address user) external view returns (uint256) {
        return users[user].totalPoints;
    }

    function getDailyQuestPoints(address user) external view returns (uint256) {
        return users[user].dailyQuestPoints;
    }

    function getActivityPoints(address user) external view returns (uint256) {
        return users[user].activityPoints;
    }

    function getActivityName(
        Activity activity
    ) external view returns (string memory) {
        return activityNames[uint256(activity)];
    }
}

